import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import Card from "@material-ui/core/Card";
import CardHeader from "@material-ui/core/CardHeader";
import Avatar from "@material-ui/core/Avatar";
import CardContent from "@material-ui/core/CardContent";
import React from "react";
import {makeStyles} from "@material-ui/core/styles";
import ministryIntern from "../images/ministryIntern.png"
import sazzIntern from "../images/sazzIntern.jpg"

const useStyles = makeStyles((theme) => ({
    root: {
        maxWidth: 345,
    },
    large: {
        width: theme.spacing(7),
        height: theme.spacing(7),
    },
}));

function WorkExperience() {
    const classes = useStyles();

    return (
        <Grid container spacing={3} style={{textAlign: 'center', margin: '1rem'}}>
            <Grid item xs={12}>
                <Typography variant="h3">Work Experience</Typography>
                <span>∞∞∞</span>
            </Grid>
            <Grid item xs={4}>
                <Card className={classes.root} style={{height: "13rem"}}>
                    <CardHeader
                        avatar={<Avatar aria-label="masters" className={classes.large} src={ministryIntern}/>}
                        title="Ergosign Ergonomie und Design GmbH"
                        subheader="UX Software Engineer Intern"
                    />
                    <CardContent>
                        <Typography variant="body2" color="textSecondary" component="p">
                            The master's thesis project on the implementation and study of the interaction
                            between autonomous devices in Social Internet of Things environment. Graded 100/100
                        </Typography>
                    </CardContent>
                </Card>
            </Grid>
            <Grid item xs={4}>
                <Card className={classes.root} style={{height: "13rem"}}>
                    <CardHeader
                        avatar={<Avatar aria-label="bachelors" className={classes.large} src={ministryIntern}/>}
                        title="Ministry of Communication"
                        subheader="Bachelor’s degree in CS"
                    />
                    <CardContent>
                        <Typography variant="body2" color="textSecondary" component="p">
                            Graduated with Granted Honors Degree.
                        </Typography>
                    </CardContent>
                </Card>
            </Grid>
            <Grid item xs={4}>
                <Card className={classes.root} style={{height: "13rem"}}>
                    <CardHeader
                        avatar={<Avatar aria-label="masters" className={classes.large} src={sazzIntern}/>}
                        title="Sazz internet service provider "
                        subheader="Master’s degree in CS"
                    />
                    <CardContent>
                        <Typography variant="body2" color="textSecondary" component="p">
                            The master's thesis project on the implementation and study of the interaction
                            between autonomous devices in Social Internet of Things environment. Graded 100/100
                        </Typography>
                    </CardContent>
                </Card>
            </Grid>
        </Grid>
    )
}

export default WorkExperience;
